import classes from './ReadyButton.module.css';

function ReadyButton({ handleClickReady }) {
  return (
    <>
      <div className={classes.readybuttonDiv}>
        <button className={classes.readyButton} onClick={handleClickReady}>
          READY
        </button>
      </div>
    </>
  );
}

BeforeGameStarts.propTypes = {
  roomData: PropTypes.shape({
    won: PropTypes.bool.isRequired,
    lost: PropTypes.bool.isRequired,
    gameStarted: PropTypes.bool.isRequired,
  }).isRequired,
  handleCopyClick: PropTypes.func.isRequired,
  isCopied: PropTypes.bool.isRequired,
  ready: PropTypes.bool.isRequired,
  show1: PropTypes.bool.isRequired,
  show2: PropTypes.bool.isRequired,
  show3: PropTypes.bool.isRequired,
  handleClickReady: PropTypes.func.isRequired,
};


export default ReadyButton;
